import React, { useState } from 'react';
import { getAuthToken, request, setAuthHeader } from '../helpers/axios_helper';

function Register(props) {
  const [formData, setFormData] = useState({
    dni: '',
    nombre: '',
    direccion: '',
    email: '',
    telefono: '',
    username: '',
    password: ''
  });
  const handleChange = (event) => {
    setFormData({ ...formData, [event.target.name]: event.target.value });
    console.log(formData);
  };

  const [userInfo, setUserInfo] = useState({
    "username": "",
    "email": "",
    "telefono": "",
    "direccion": "",
    "dni": "",
    "nombre": ""
  });

  const onRegister = async (event, formData) => {
    event.preventDefault();
    console.log(formData)
    request('POST', '/register', formData).then(
      (response) => {
        setAuthHeader(response.data.token);
        setUserInfo({
          "username": response.data.username,
          "email": response.data.email,
          "telefono": response.data.telefono,
          "direccion": response.data.direccion,
          "dni": response.data.dni,
          "nombre": response.data.nombre
        });
        window.location.href = "/";
        console.log(response.data);
      }).catch(
        (error) => {
          setAuthHeader(null);
        }
      );
  };

  return (
    <div className="register-form">
      <h2>Register</h2>
      <form onSubmit={onRegister}>
        <div className="form-group">
          <label htmlFor="username">Username</label>
          <input
            type="text"
            className="form-control"
            id="username"
            name="username"
            value={formData.username}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="password">Password</label>
          <input
            type="password"
            className="form-control"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="dni">DNI</label>
          <input
            type="text"
            className="form-control"
            id="dni"
            name="dni"
            value={formData.dni}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="nombre">Full Name</label>
          <input
            type="text"
            className="form-control"
            id="nombre"
            name="nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="direccion">Address</label>
          <input
            type="text"
            className="form-control"
            id="direccion"
            name="direccion"
            value={formData.direccion}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email</label>
          <input
            type="text"
            className="form-control"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="telefono">Phone Number</label>
          <input
            type="text" 
            className="form-control"
            id="telefono"
            name="telefono"
            value={formData.telefono}
            onChange={handleChange}
          />
        </div>
        {Object.keys(validationErrors).length > 0 && (  // Display errors if any
          <div className="error-messages">
            {Object.values(validationErrors).map((error) => (
              <p key={error}>{error}</p>
            ))}
          </div>
        )}
        <button type="submit" className="btn btn-primary">
          Register
        </button>
      </form>
    </div>
  );
}

export default Register;
